import React, { useState } from 'react'

function Color() {
    // Buton etkileşimi için değeri ve setlenmesi
    const [color, setCount] = useState("red","green","blue");

    return (
        <div>
            <button onClick={() => setCount(color + 1)}> Login </button>
            <h1> {[color]} </h1>
        </div>
    )
}

export default Color
